import React from 'react';
import '../../css/tweets/TweetDisplayMenu.css';

class TweetDisplayMenu extends React.Component {
    constructor(props) {
        super(props);

    } 


    render() {

        return (
            <div className="TweetBtnContainer">
                <div className="TweetBtn" onClick={this.props.onChangeTweetState('Edit')}>DELETE</div>
                <div className="TweetBtn" onClick={this.props.onChangeTweetState('Delete')}>EDIT</div>
            </div>
            );
    }
}

export default TweetDisplayMenu;
